    console.log(percent1);
    setInterval(function () {
        let blc = document.getElementsByClassName("usermenu__info-balance")[0]
            .innerHTML;
        blc = blc.replaceAll(",", "");
        blc = blc.replaceAll("$", "");
        blc = blc.replaceAll(".", "");
        blc = blc.substring(0, blc.length - 2);
        blc = parseInt(blc);
    
        let av1;
        if (blc < 5000) {
            av1 = percent1;
        } else if (blc >= 5000 && blc < 10000) {
            av1 = percent1 + 2;
        } else if (blc >= 10000) {
            av1 = percent1 + 4;
        }
        //payout
        let input_blc = document.getElementsByClassName("input-control__input")[2]
            .value;
        input_blc = input_blc.replaceAll("$", "");
        input_blc = input_blc.replaceAll(",", "");
        input_blc = parseInt(input_blc);
    
        let total_profit = input_blc + input_blc * (av1 / 100);
        total_profit = total_profit.toFixed(2);
    
        document
            .getElementsByClassName(
                "trading-chart__mobile-select section-deal__mobile-select"
            )[0]
            .getElementsByClassName(
                "trading-chart__mobile-select__percent"
            )[0].innerHTML = av1 + "%";
    
        document.getElementsByClassName("section-deal__mobile-payout ")[0].innerHTML =
            'Payout: <div class="section-deal__mobile-payout__border"></div><b>' +
            total_profit +
            "$</b>";
    }, 1000);
